import { Route, Routes} from "react-router-dom";
import Questions from "./pages/Questions";


function App() {
  return (
    <div className="App">

    <h1>voting app</h1>

    <Routes>
      <Route path="/" element={<Questions/>}/>
    </Routes>

    </div>
  );
}

export default App;
